contract VendingMachine is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
 
    IERC1155Mintable public nft;
    IERC20 public quoteErc20;

    address public treasury;
    
    mapping(uint256 => uint256) public _commodityPrices;

    event PriceUpdate(uint256 indexed tokenId, uint256 price);
    event Buy(address indexed buyer, uint256 indexed tokenId, uint256 quantity, uint256 price);

    constructor(
        address _nftAddress,
        address _quoteErc20Address,
        address _treasury
    ) {
        require(_nftAddress != address(0) && _nftAddress != address(this));
        require(_quoteErc20Address != address(0) && _quoteErc20Address != address(this));
        nft = IERC1155Mintable(_nftAddress);
        quoteErc20 = IERC20(_quoteErc20Address);
        treasury = _treasury;
    }
    
    function _listToken(uint256 _tokenId, uint256 _price) internal {
        _commodityPrices[_tokenId] = _price;
        emit PriceUpdate( _tokenId, _price);
    }
    
    function safeListToken(uint256 _tokenId, uint256 _price) public onlyOwner {
        _listToken(_tokenId, _price);
    }
    
    function _buyToken(address _buyer, uint256 _tokenId, uint256 _quantity) internal {
        nft.safeMint(_buyer, _tokenId, _quantity);
        quoteErc20.safeTransferFrom(_buyer, treasury, _commodityPrices[_tokenId].mul(_quantity));
        
        emit Buy(_buyer, _tokenId, _quantity, _commodityPrices[_tokenId]);
    }
    
    function safeBuyToken(uint256 _tokenId, uint256 _quantity) public {
        require(_commodityPrices[_tokenId]>0, "Not on list");
        _buyToken(_msgSender(), _tokenId, _quantity);
    }
    
}

